// Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
  const navigate = useNavigate();

  return (
    <div>
      <button onClick={() => navigate('/input')}>Start</button>
      <button onClick={() => navigate('/records')}>Records</button>
    </div>
  );
}

export default Home;
